import React from "react";
import styles from './index.module.scss';

export class Input extends React.Component<any, any> {
    render() {
        return (
            <input type="text" autoComplete="off" value={this.props.value}  onChange={(e) => {this.props.onChange(e)}} />
        );
    }
}

export class Textarea extends React.Component<any, any> {
    render() {
        return (
            <textarea autoComplete="off" value={this.props.value}  onChange={() => {this.props.onChange()}} />
        );
    }
}

class TravelForm extends React.Component<any, any> {
    constructor(props) {
        super(props);
        this.state = {
            inputs: {
                name: '',
                elephone: null,
                departure: '',
                time: '',
                count: null,
                old: null,
                children: null,
            },
            textareas: {
                city: '',
                mustScenicSpots: '',
                remarks: '',
            }
        };
    }

    render() {
        return (
            <div>
                <div className={styles.inputForm}>
                    姓名：
                    <input type="text" autoComplete="off" value={this.props.value}  onChange={() => {this.props.onChange()}} />
                    电话:
                    <input type="number" autoComplete="off" />
                    出发地:
                    <input type="text" autoComplete="off" />
                    旅行时间:
                    <input type="text" autoComplete="off" />
                    旅行人数:
                    <input type="number" autoComplete="off" />
                    老人人数:
                    <input type="number" autoComplete="off" />
                    孩子人数:
                    <input type="number" autoComplete="off" />
                </div>
                <div className={styles.textareaFrom}>
                    旅行城市:
                    <textarea autoComplete="off" />
                    必玩景区:
                    <textarea autoComplete="off" />
                    备注:
                    <textarea autoComplete="off" />
                </div>
            </div>
        );
    }
}

export class Traveler extends React.Component<any, any> {

    find = () => {
        this.props.history.push('/TravelPlanShow')
    }

    informaion
    submit(informaion) {
        console.log(informaion)
    }

    render() {
        console.log(this.informaion);
        return (
            <div className={styles.container}>
                <TravelForm ref={(ref) => {this.informaion = ref}} />
                <div className={styles.choose}>
                    <button onClick={this.find}>查询</button>
                    <button onClick={() => this.submit(this.informaion)}>提交</button>
                </div>
                {/* <div className={styles.plan}>
                    <div>旅行计划：</div>
                    <div className={styles.planShow}></div>
                </div> */}
            </div>
        );
    }
}
